import React, { Component } from "react";
import { Form, Header } from "semantic-ui-react";
//import "./auth.css";
import logo from "../images/logo.png";

class Layout extends Component {
    render() {
        return (
          <div className="auth-main">
            <div class="auth-content">
              <div className="auth-card">
                <img src='https://banner2.cleanpng.com/20180418/gre/kisspng-human-resources-login-management-information-payro-track-5ad7cda3586cb1.5605091515240923233622.jpg' className="auth-logo" />
                <Header as="h2" color="black" textAlign="center">
                  {this.props.header}
                </Header>
                <Form.Group size="large" className="auth-form" autocomplete="off">
                  {this.props.children}
                </Form.Group>
              </div>
            </div>
          </div>
        );
      }
}

export default Layout
